import Metrics from './components/metrics';

function App() {

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div className="container-fluid">
        <div className="row">
          <Timestamps />
          <Metrics  />
        </div>
      </div>

    </div>
  )  
}

export default App;
